&lt;h2&gt;Trajectory Forecast&lt;br /&gt;Mississippi Canyon 252&lt;/h2&gt;
		&lt;h3&gt;NOAA/NOS/OR&amp;R&lt;/h3&gt;
		&lt;p&gt;Estimates for:&lt;/p&gt;
		&lt;ul&gt;
			&lt;li&gt;Saturday May 8, 2010, 06:00 CDT&lt;/li&gt;
			&lt;li&gt;Sunday May 9, 2010, 06:00 CDT&lt;/li&gt;
			&lt;li&gt;Monday May 10, 2010, 06:00 CDT&lt;/li&gt;
		&lt;/ul&gt;
		&lt;p&gt;Date Prepared: Friday May 7, 2010, 13:00 CDT&lt;/p&gt;
		&lt;p&gt;This forecast is based on the NWS spot forecast . Currents were obtained from the NOAA	Gulf of Mexico model, Texas A&amp;M/TGLO, NAVO models, and HFR data. The model was initialized from SLAR data obtained during a Transport Canada overflight Monday AM and satellite imagery from Monday evening(NOAA/NESDIS). The leading edge may contain tarballs that are not readily observable from the imagery (hence not included in the model initialization).&lt;/p&gt;
